import React from 'react';
import './App.css';
import { Layout, Header, Navigation, Content } from 'react-mdl';
import { Link } from 'react-router-dom';
import { Grid, Cell } from 'react-mdl'
// import Main from './components/main'
import Landing from './components/landingpage'
import Projects from './components/projects';

import AboutMe from './components/aboutme';
import Contact from './components/contact';

function App() {
  return (
    <div className="demo-big-content">
      <Layout fixedHeader>
        <Header className="header-color" title={<Link style={{ textDecoration: 'none', color: 'white' }} to="#landing">Neeraj Singhi</Link>} scroll>
          <Navigation>
            {/* <Link to="/resume">Resume</Link> */}
            <a href="#projects">Projects</a>

            <a href="#aboutme">About Me</a>
            <a href="#contact">Contact</a>
          </Navigation>
        </Header>

        <Content>
          <div className="page-content"/>
          <Grid className="demo-grid-1" id="landing">
            <Cell col={12}><Landing /></Cell>
          </Grid>
          <Grid className="demo-grid-2" id="projects">
            <Cell col={12}><Projects /></Cell>
          </Grid>
          <Grid className="demo-grid-3" id="aboutme">
            <Cell col={12}><AboutMe /></Cell>
          </Grid>
          <Grid className="demo-grid-4" id="contact">
            <Cell col={12}><Contact /></Cell>
          </Grid>
        </Content>
      </Layout>
    </div>
  );
}

export default App;
